[{"name": "mcp__togomcp__run_sparql", "input": {"dbname": "pdb", "sparql_query": "
PREFIX pdbx: <http://pdbj.org/schema/pdbx-v50.owl#>
PREFIX pdbo: <http://rdf.wwpdb.org/schema/pdbx-v50.owl#>
PREFIX rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>

SELECT ?r_work ?r_free ?resolution
WHERE {
  ?refine a pdbo:pdbx_refine ;
         pdbo:pdbx_refine.entry_id "5D8V" ;
         pdbo:pdbx_refine.ls_R_factor_R_work ?r_work .

  OPTIONAL { ?refine pdbo:pdbx_refine.ls_R_factor_R_free ?r_free }

  OPTIONAL {
    ?reflns a pdbo:refln ;
           pdbo:refln.entry_id "5D8V" ;
           pdbo:refln.d_resolution_high ?resolution .
  }
}
"}}, {"name": "mcp__togomcp__run_sparql", "input": {"dbname": "pdb", "sparql_query": "
PREFIX pdbo: <http://rdf.wwpdb.org/schema/pdbx-v50.owl#>

SELECT ?property ?value
WHERE {
  ?refine a pdbo:pdbx_refine ;
         pdbo:pdbx_refine.entry_id "5D8V" ;
         ?property ?value .
}
LIMIT 100
"}}, {"name": "mcp__togomcp__search_pdb_entity", "input": {"db": "pdb", "query": "5D8V", "limit": 5}}, {"name": "mcp__togomcp__run_sparql", "input": {"dbname": "pdb", "sparql_query": "
PREFIX rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX PDBo: <http://rdf.wwpdb.org/schema/pdbx-v50.owl#>

SELECT ?r_work ?r_free ?resolution
WHERE {
  ?s a PDBo:pdbx_refineType ;
     PDBo:pdbx_refine.entry_id "5D8V" ;
     PDBo:pdbx_refine.ls_R_factor_R_work ?r_work .

  OPTIONAL { ?s PDBo:pdbx_refine.ls_R_factor_R_free ?r_free }

  OPTIONAL {
    ?ref a PDBo:reflnType ;
         PDBo:refln.entry_id "5D8V" ;
         PDBo:refln.d_resolution_high ?resolution .
  }
}
"}}, {"name": "mcp__togomcp__get_sparql_example", "input": {"dbname": "pdb"}}, {"name": "mcp__togomcp__run_sparql", "input": {"dbname": "pdb", "sparql_query": "
PREFIX pdbo: <https://rdf.wwpdb.org/schema/pdbx-v50.owl#>
PREFIX dct: <http://purl.org/dc/terms/>

SELECT ?r_work ?r_free ?resolution
FROM <http://rdfportal.org/dataset/pdbj>
WHERE {
    ?PDB a pdbo:datablock ;
        dct:identifier "5D8V" ;
        pdbo:has_pdbx_refineCategory / pdbo:has_pdbx_refine ?refine .

    ?refine pdbo:pdbx_refine.ls_R_factor_R_work ?r_work .

    OPTIONAL { ?refine pdbo:pdbx_refine.ls_R_factor_R_free ?r_free }

    OPTIONAL {
        ?PDB pdbo:has_reflnCategory / pdbo:has_refln ?reflnObj .
        ?reflnObj pdbo:refln.d_resolution_high ?resolution .
    }
}
"}}, {"name": "mcp__togomcp__get_MIE_file", "input": {"dbname": "pdb"}}, {"name": "mcp__togomcp__run_sparql", "input": {"dbname": "pdb", "sparql_query": "
PREFIX pdbx: <http://rdf.wwpdb.org/schema/pdbx-v50.owl#>
PREFIX xsd: <http://www.w3.org/2001/XMLSchema#>

SELECT ?r_work ?r_free ?resolution
FROM <http://rdfportal.org/dataset/pdbj>
WHERE {
  ?entry a pdbx:datablock .
  BIND(STRAFTER(str(?entry), "http://rdf.wwpdb.org/pdb/") AS ?entry_id)
  FILTER(?entry_id = "5D8V")

  ?entry pdbx:has_refineCategory/pdbx:has_refine ?refine .

  ?refine pdbx:refine.ls_R_factor_R_work ?r_work .

  OPTIONAL { ?refine pdbx:refine.ls_R_factor_R_free ?r_free }
  OPTIONAL { ?refine pdbx:refine.ls_d_res_high ?resolution }
}
"}}]

[{"name": "mcp__togomcp__search_reactome_entity", "input": {"query": "protein tyrosine kinase", "rows": 20}}, {"name": "mcp__togomcp__get_MIE_file", "input": {"dbname": "reactome"}}, {"name": "mcp__togomcp__run_sparql", "input": {"dbname": "reactome", "sparql_query": "PREFIX bp: <http://www.biopax.org/release/biopax-level3.owl#>
PREFIX xsd: <http://www.w3.org/2001/XMLSchema#>

SELECT DISTINCT ?reaction ?reactionName ?ecNumber
FROM <http://rdf.ebi.ac.uk/dataset/reactome>
WHERE {
  ?reaction a bp:BiochemicalReaction ;
    bp:displayName ?reactionName ;
    bp:eCNumber ?ecNumber .
  ?reactionName bif:contains "'tyrosine' AND 'kinase'" option (score ?sc)
}
ORDER BY DESC(?sc)
LIMIT 50"}}, {"name": "mcp__togomcp__run_sparql", "input": {"dbname": "reactome", "sparql_query": "PREFIX bp: <http://www.biopax.org/release/biopax-level3.owl#>
PREFIX xsd: <http://www.w3.org/2001/XMLSchema#>

SELECT DISTINCT ?ecNumber (COUNT(?reaction) as ?count)
FROM <http://rdf.ebi.ac.uk/dataset/reactome>
WHERE {
  ?reaction a bp:BiochemicalReaction ;
    bp:displayName ?reactionName ;
    bp:eCNumber ?ecNumber .
  FILTER(CONTAINS(STR(?ecNumber), "2.7.10"))
}
GROUP BY ?ecNumber
ORDER BY ?ecNumber
LIMIT 50"}}, {"name": "mcp__togomcp__run_sparql", "input": {"dbname": "reactome", "sparql_query": "PREFIX bp: <http://www.biopax.org/release/biopax-level3.owl#>
PREFIX xsd: <http://www.w3.org/2001/XMLSchema#>

SELECT DISTINCT ?ecNumber ?reactionName
FROM <http://rdf.ebi.ac.uk/dataset/reactome>
WHERE {
  ?reaction a bp:BiochemicalReaction ;
    bp:displayName ?reactionName ;
    bp:eCNumber ?ecNumber .
  FILTER(?ecNumber = "2.7.10.1" || ?ecNumber = "2.7.10.2")
}
ORDER BY ?ecNumber
LIMIT 20"}}, {"name": "mcp__togomcp__run_sparql", "input": {"dbname": "reactome", "sparql_query": "PREFIX bp: <http://www.biopax.org/release/biopax-level3.owl#>

SELECT DISTINCT ?ecNumber ?reactionName
FROM <http://rdf.ebi.ac.uk/dataset/reactome>
WHERE {
  ?reaction a bp:BiochemicalReaction ;
    bp:displayName ?reactionName ;
    bp:eCNumber ?ecNumber .
  FILTER(REGEX(STR(?ecNumber), "^2\\.7\\.10"))
}
LIMIT 10"}}, {"name": "mcp__togomcp__run_sparql", "input": {"dbname": "reactome", "sparql_query": "PREFIX bp: <http://www.biopax.org/release/biopax-level3.owl#>

SELECT DISTINCT ?ecNumber ?reactionName
FROM <http://rdf.ebi.ac.uk/dataset/reactome>
WHERE {
  ?reaction a bp:BiochemicalReaction ;
    bp:displayName ?reactionName ;
    bp:eCNumber "2.7.10.1" .
}
LIMIT 10"}}, {"name": "mcp__togomcp__run_sparql", "input": {"dbname": "reactome", "sparql_query": "PREFIX bp: <http://www.biopax.org/release/biopax-level3.owl#>

SELECT DISTINCT ?ecNumber ?reactionName
FROM <http://rdf.ebi.ac.uk/dataset/reactome>
WHERE {
  ?reaction a bp:BiochemicalReaction ;
    bp:displayName ?reactionName ;
