[{"name": "mcp__togomcp__search_reactome_entity", "input": {"query": "mTOR signaling", "rows": 20}}, {"name": "mcp__togomcp__run_sparql", "input": {"dbname": "reactome", "sparql_query": "PREFIX rh: <http://www.reactome.org/biopax/72/48887#>
PREFIX bp: <http://www.biopax.org/release/biopax-level3.owl#>
PREFIX up: <http://purl.uniprot.org/core/>

SELECT DISTINCT ?protein ?uniprotAcc ?displayName
WHERE {
  # Get entities in the mTOR signalling pathway
  <http://www.reactome.org/biopax/72/48887#Pathway1149> bp:pathwayComponent* ?component .

  ?component bp:participant ?entity .

  # Get proteins
  ?entity a bp:Protein ;
          bp:entityReference ?proteinRef .

  ?proteinRef bp:xref ?xref .
  ?xref a bp:UnificationXref ;
        bp:db "UniProt" ;
        bp:id ?uniprotAcc .

  OPTIONAL { ?entity bp:displayName ?displayName }

  BIND(?entity as ?protein)
}
LIMIT 100"}}, {"name": "mcp__togomcp__get_sparql_example", "input": {"dbname": "reactome"}}, {"name": "mcp__togomcp__run_sparql", "input": {"dbname": "reactome", "sparql_query": "PREFIX biopax: <http://www.biopax.org/release/biopax-level3.owl#>

SELECT DISTINCT ?protein_name ?uniprot_id
FROM <http://rdf.ebi.ac.uk/dataset/reactome>
WHERE {
    ?Pathway a biopax:Pathway ;
        biopax:displayName ?pathway_name .

    FILTER(CONTAINS(LCASE(?pathway_name), "mtor"))

    # Get proteins from pathway components
    {
        ?Pathway biopax:pathwayComponent ?component .
        ?component biopax:left ?protein .
    } UNION {
        ?Pathway biopax:pathwayComponent ?component .
        ?component biopax:right ?protein .
    } UNION {
        ?Pathway biopax:pathwayComponent ?component .
        ?component biopax:controlled ?protein .
    }

    ?protein a biopax:Protein ;
        biopax:displayName ?protein_name ;
        biopax:entityReference ?proteinRef .

    ?proteinRef biopax:xref ?xref .
    ?xref a biopax:UnificationXref ;
        biopax:db "UniProt" ;
        biopax:id ?uniprot_id .
}
LIMIT 200"}}, {"name": "mcp__togomcp__run_sparql", "input": {"dbname": "reactome", "sparql_query": "PREFIX biopax: <http://www.biopax.org/release/biopax-level3.owl#>

SELECT DISTINCT ?pathway_id ?pathway_name
FROM <http://rdf.ebi.ac.uk/dataset/reactome>
WHERE {
    ?Pathway a biopax:Pathway ;
        biopax:displayName ?pathway_name ;
        biopax:xref ?xref .

    ?xref a biopax:UnificationXref ;
        biopax:db "Reactome" ;
        biopax:id ?pathway_id .

    FILTER(CONTAINS(LCASE(?pathway_name), "mtor") && CONTAINS(?pathway_id, "R-HSA"))
}
LIMIT 50"}}, {"name": "mcp__togomcp__run_sparql", "input": {"dbname": "reactome", "sparql_query": "PREFIX biopax: <http://www.biopax.org/release/biopax-level3.owl#>

SELECT DISTINCT ?pathway_name ?protein_db ?protein_id
FROM <http://rdf.ebi.ac.uk/dataset/reactome>
WHERE {
    ?Pathway a biopax:Pathway ;
        biopax:displayName ?pathway_name .

    FILTER(CONTAINS(?pathway_name, "MTOR"))

    ?Pathway biopax:pathwayComponent ?component .
    ?component biopax:left|biopax:right ?entity .
    ?entity biopax:entityReference ?ref .
    ?ref biopax:xref ?xref .
    ?xref a biopax:UnificationXref ;
        biopax:db ?protein_db ;
        biopax:id ?protein_id .

    FILTER(?protein_db = "UniProt")
}
LIMIT 100"}}, {"name": "mcp__togomcp__togoid_getAllRelation", "input": {}}, {"name": "mcp__togomcp__togoid_convertId", "input": {"ids": "R-HSA-165159", "route": "reactome_pathway,uniprot", "limit": 10000}}, {"name": "mcp__togomcp__togoid_convertId", "input": {"ids": "R-HSA-380972", "route": "reactome_pathway,uniprot", "limit": 10000}}, {"name": "mcp__togomcp__run_sparql", "input": {"dbname": "uniprot", "sparql_query": "PREFIX up: <http://purl.uniprot.org/core/>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>

SELECT DISTINCT ?acc ?protein_name ?gene_name
WHERE {
  VALUES ?acc { "P42345" "Q15382" "P49815" "O43504" "Q13541" "P06730" "P31749" "P31751" }

  ?protein a up:Protein ;
           up:mnemonic ?acc ;
           up:recommendedName ?recName .

  ?recName up:fullName ?recFullName .
  ?recFullName rdfs:label ?protein_name .

  OPTIONAL {
    ?protein up:encodedBy ?gene .
    ?gene up:locusName ?gene_name .
  }
}
LIMIT 100"}}, {"name": "mcp__togomcp__search_uniprot_entity", "input": {"query": "P42345", "limit": 5}}, {"name": "mcp__togomcp__search_uniprot_entity", "input": {"query": "Q13541", "limit": 5}}, {"name": "mcp__togomcp__search_uniprot_entity", "input": {"query": "P49815", "limit": 5}}, {"name": "mcp__togomcp__search_uniprot_entity", "input": {"query": "O43504", "limit": 5}}]

[{"name": "mcp__togomcp__search_chembl_target", "input": {"query": "kinase NOT tyrosine", "limit": 20}}, {"name": "mcp__togomcp__search_chembl_target", "input": {"query": "serine threonine kinase", "limit": 20}}, {"name": "mcp__togomcp__get_MIE_file", "input": {"dbname": "chembl"}}, {"name": "mcp__togomcp__run_sparql", "input": {"dbname": "chembl", "sparql_query": "PREFIX cco: <http://rdf.ebi.ac.uk/terms/chembl#>

SELECT DISTINCT ?molecule ?moleculeLabel ?target ?targetLabel ?value ?chemblId
FROM <http://rdf.ebi.ac.uk/dataset/chembl>
WHERE {
  ?activity a cco:Activity ;
            cco:standardType "IC50" ;
            cco:standardValue ?value ;
            cco:standardUnits "nM" ;
            cco:hasMolecule ?molecule ;
            cco:hasAssay/cco:hasTarget ?target .
  ?target rdfs:label ?targetLabel ;
          cco:organismName "Homo sapiens" .
  ?molecule rdfs:label ?moleculeLabel ;
            cco:chemblId ?chemblId .
  ?targetLabel bif:contains "('kinase' AND NOT 'tyrosine')" option (score ?sc)
  FILTER(xsd:decimal(?value) < 10)
}
ORDER BY ?value DESC(?sc)
LIMIT 100"}}, {"name": "mcp__togomcp__run_sparql", "input": {"dbname": "chembl", "sparql_query": "PREFIX cco: <http://rdf.ebi.ac.uk/terms/chembl#>

SELECT DISTINCT ?molecule ?moleculeLabel ?chemblId ?target ?targetLabel ?value ?units ?pChembl
FROM <http://rdf.ebi.ac.uk/dataset/chembl>
WHERE {
  ?activity a cco:Activity ;
            cco:standardType "IC50" ;
            cco:standardValue ?value ;
            cco:standardUnits ?units ;
            cco:hasMolecule ?molecule ;
            cco:hasAssay/cco:hasTarget ?target .
  ?target rdfs:label ?targetLabel ;
          cco:organismName "Homo sapiens" .
  ?molecule rdfs:label ?moleculeLabel ;
            cco:chemblId ?chemblId .
  OPTIONAL { ?activity cco:pChembl ?pChembl }
  ?targetLabel bif:contains "('kinase' AND NOT 'tyrosine')" option (score ?sc)
  FILTER(xsd:decimal(?value) > 0 && xsd:decimal(?value) < 10 && ?units = "nM")
}
ORDER BY ?value DESC(?sc)
LIMIT 100"}}, {"name": "mcp__togomcp__run_sparql", "input": {"dbname": "chembl", "sparql_query": "PREFIX cco: <http://rdf.ebi.ac.uk/terms/chembl#>

SELECT DISTINCT ?chemblId ?moleculeLabel ?targetLabel ?value ?units
FROM <http://rdf.ebi.ac.uk/dataset/chembl>
WHERE {
  ?activity a cco:Activity ;
            cco:standardType "IC50" ;
            cco:standardValue ?value ;
            cco:standardUnits ?units ;
            cco:hasMolecule ?molecule ;
            cco:hasAssay/cco:hasTarget ?target .
  ?target rdfs:label ?targetLabel ;
          cco:organismName "Homo sapiens" .
  ?molecule rdfs:label ?moleculeLabel ;
            cco:chemblId ?chemblId .
  ?targetLabel bif:contains "('kinase' AND NOT 'tyrosine')" option (score ?sc)
  FILTER(?units = "nM" && xsd:decimal(?value) >= 0.01 && xsd:decimal(?value) < 10.0)
}
ORDER BY ?value DESC(?sc)
LIMIT 50"}}, {"name": "mcp__togomcp__run_sparql", "input": {"dbname": "chembl", "sparql_query": "PREFIX cco: <http://rdf.ebi.ac.uk/terms/chembl#>

SELECT DISTINCT ?chemblId ?moleculeLabel ?targetLabel (MIN(?value) AS ?minIC50) ?targetChemblId
FROM <http://rdf.ebi.ac.uk/dataset/chembl>
WHERE {
  ?activity a cco:Activity ;
            cco:standardType "IC50" ;
            cco:standardValue ?value ;
            cco:standardUnits "nM" ;
            cco:hasMolecule ?molecule ;
            cco:hasAssay/cco:hasTarget ?target .
  ?target rdfs:label ?targetLabel ;
          cco:organismName "Homo sapiens" ;
          cco:chemblId ?targetChemblId .
  ?molecule rdfs:label ?moleculeLabel ;
            cco:chemblId ?chemblId .
  ?targetLabel bif:contains "('kinase' AND NOT 'tyrosine')" option (score ?sc)
  FILTER(xsd:decimal(?value) >= 0.01 && xsd:decimal(?value) < 10.0)
}
GROUP BY ?chemblId ?moleculeLabel ?targetLabel ?targetChemblId
ORDER BY ?minIC50 DESC(?sc)
LIMIT 100"}}, {"name": "mcp__togomcp__run_sparql", "input": {"dbname": "chembl", "sparql_query": "PREFIX cco: <http://rdf.ebi.ac.uk/terms/chembl#>

SELECT DISTINCT ?chemblId ?moleculeLabel ?targetLabel ?value ?targetChemblId
FROM <http://rdf.ebi.ac.uk/dataset/chembl>
WHERE {
  ?activity a cco:Activity ;
            cco:standardType "IC50" ;
            cco:standardValue ?value ;
            cco:standardUnits "nM" ;
            cco:hasMolecule ?molecule ;
            cco:hasAssay/cco:hasTarget ?target .
  ?target rdfs:label ?targetLabel ;
          cco:organismName "Homo sapiens" ;
          cco:chemblId ?targetChemblId .
  ?molecule rdfs:label ?moleculeLabel ;
            cco:chemblId ?chemblId .
  ?targetLabel bif:contains "('kinase' AND NOT 'tyrosine')" option (score ?sc)
  FILTER(xsd:decimal(?value) >= 0.01 && xsd:decimal(?value) < 10.0)
}
ORDER BY ?value DESC(?sc)
LIMIT 100"}}]
